import{_ as e,c as l,o as n,ae as d}from"./chunks/framework.D7Xxp1-g.js";const h=JSON.parse('{"title":"通讯格式","description":"","frontmatter":{},"headers":[],"relativePath":"gt01/protocol.md","filePath":"gt01/protocol.md"}'),a={name:"gt01/protocol.md"};function r(i,t,s,y,g,x){return n(),l("div",null,t[0]||(t[0]=[d('<h1 id="通讯格式" tabindex="-1">通讯格式 <a class="header-anchor" href="#通讯格式" aria-label="Permalink to &quot;通讯格式&quot;">​</a></h1><p>协议版本：1.0</p><h2 id="通讯参数" tabindex="-1">通讯参数 <a class="header-anchor" href="#通讯参数" aria-label="Permalink to &quot;通讯参数&quot;">​</a></h2><ul><li>波特率：500K</li><li>帧类型：标准帧</li></ul><h2 id="上位机下发指令" tabindex="-1">上位机下发指令 <a class="header-anchor" href="#上位机下发指令" aria-label="Permalink to &quot;上位机下发指令&quot;">​</a></h2><p>当遥控器未开启时，可直接由CAN控制。在遥控器模式下需要将SWB开关拨到中间档位。</p><h3 id="线速度、角速度设置指令" tabindex="-1">线速度、角速度设置指令 <a class="header-anchor" href="#线速度、角速度设置指令" aria-label="Permalink to &quot;线速度、角速度设置指令&quot;">​</a></h3><p>CAN_ID：0x01</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0</td><td style="text-align:center;">线速度低八位</td><td style="text-align:center;">int16</td><td style="text-align:center;">单位mm/s</td></tr><tr><td style="text-align:center;">Byte 1</td><td style="text-align:center;">线速度高八位</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">Byte 2</td><td style="text-align:center;">角速度低八位</td><td style="text-align:center;">int16</td><td style="text-align:center;">单位：0.001rad/s</td></tr><tr><td style="text-align:center;">Byte 3</td><td style="text-align:center;">角速度高八位</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">Byte 4~7</td><td style="text-align:center;">保留</td><td style="text-align:center;"></td><td style="text-align:center;">保留</td></tr></tbody></table><p><strong>示例</strong>：</p><ul><li>线速度1000 mm/s 角速度0 rad/s：01 01 E8 03 00 00 00 00</li><li>线速度0 mm/s 角速度0.1rad/s：01 01 00 00 64 00 00 00</li><li>线速度100mm/s 角速度0.1rad/s：01 01 64 00 64 00 00 00</li><li>线速度-1000mm/s 角速度-0.1rad/s：01 01 18 FC 9C FF 00 00</li></ul><h3 id="左、右轮速设置指令" tabindex="-1">左、右轮速设置指令 <a class="header-anchor" href="#左、右轮速设置指令" aria-label="Permalink to &quot;左、右轮速设置指令&quot;">​</a></h3><p>CAN_ID：0x01</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0</td><td style="text-align:center;">0x01</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">固定</td></tr><tr><td style="text-align:center;">Byte 1</td><td style="text-align:center;">左轮速度低八位</td><td style="text-align:center;">int16</td><td style="text-align:center;">单位mm/s</td></tr><tr><td style="text-align:center;">Byte 2</td><td style="text-align:center;">左轮速度高八位</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">Byte 3</td><td style="text-align:center;">右轮速度低八位</td><td style="text-align:center;">int16</td><td style="text-align:center;">单位mm/s</td></tr><tr><td style="text-align:center;">Byte 4</td><td style="text-align:center;">右轮速度高八位</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">Byte 5~7</td><td style="text-align:center;">保留</td><td style="text-align:center;"></td><td style="text-align:center;">保留</td></tr></tbody></table><p><strong>示例</strong>：</p><ul><li>左轮度100mm/s 右轮速100mm/s：01 64 00 64 00 00 00</li><li>左轮度100mm/s 右轮速200mm/s：01 64 00 C8 00 00 00</li><li>左轮度-200mm/s 右轮速-200mm/s：01 38 FF 38 FF 00 00</li></ul><h3 id="启用-取消软件急停" tabindex="-1">启用/取消软件急停 <a class="header-anchor" href="#启用-取消软件急停" aria-label="Permalink to &quot;启用/取消软件急停&quot;">​</a></h3><p>CAN_ID：0x01</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0</td><td style="text-align:center;">0x01</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">固定</td></tr><tr><td style="text-align:center;">Byte 1</td><td style="text-align:center;">0x0F</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">命令</td></tr><tr><td style="text-align:center;">Byte 2</td><td style="text-align:center;">0x00/0x01</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">0x00：取消急停<br>0x01：启用急停</td></tr><tr><td style="text-align:center;">Byte 3~Byte 7</td><td style="text-align:center;">保留</td><td style="text-align:center;"></td><td style="text-align:center;">保留</td></tr></tbody></table><p><strong>示例</strong>：</p><ul><li>启用急停：01 0F 01 00 00 00 00 00</li><li>取消急停：01 0F 00 00 00 00 00 00</li></ul><h3 id="回充设置" tabindex="-1">回充设置 <a class="header-anchor" href="#回充设置" aria-label="Permalink to &quot;回充设置&quot;">​</a></h3><p>CAN_ID：0x01</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0</td><td style="text-align:center;">0x01</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">固定</td></tr><tr><td style="text-align:center;">Byte 1</td><td style="text-align:center;">0x10</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">命令</td></tr><tr><td style="text-align:center;">Byte 2</td><td style="text-align:center;">0x01</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">0：关闭回充<br>1：开启红外回充<br>2：开启激光回充</td></tr><tr><td style="text-align:center;">Byte 3~Byte 7</td><td style="text-align:center;">保留</td><td style="text-align:center;"></td><td style="text-align:center;">保留</td></tr></tbody></table><p><strong>示例</strong>：</p><ul><li>关闭回充：01 10 00 00 00 00 00 00</li><li>开启红外回充：01 10 01 00 00 00 00 00</li><li>开启激光回充：01 10 02 00 00 00 00 00</li></ul><h3 id="尝试清除错误状态" tabindex="-1">尝试清除错误状态 <a class="header-anchor" href="#尝试清除错误状态" aria-label="Permalink to &quot;尝试清除错误状态&quot;">​</a></h3><p>CAN_ID：0x01</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0</td><td style="text-align:center;">0x01</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">固定</td></tr><tr><td style="text-align:center;">Byte 1</td><td style="text-align:center;">0x21</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">命令</td></tr><tr><td style="text-align:center;">Byte 2</td><td style="text-align:center;">0x01</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">1：清除</td></tr><tr><td style="text-align:center;">Byte 3~Byte 7</td><td style="text-align:center;">保留</td><td style="text-align:center;"></td><td style="text-align:center;">保留</td></tr></tbody></table><p><strong>示例</strong>：</p><ul><li>尝试清除错误状态：01 21 01 00 00 00 00 00</li></ul><h3 id="查询软件信息" tabindex="-1">查询软件信息 <a class="header-anchor" href="#查询软件信息" aria-label="Permalink to &quot;查询软件信息&quot;">​</a></h3><p>CAN_ID：0x01</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0</td><td style="text-align:center;">0x01</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">固定</td></tr><tr><td style="text-align:center;">Byte 1</td><td style="text-align:center;">0x31</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">命令</td></tr><tr><td style="text-align:center;">Byte 2~Byte 7</td><td style="text-align:center;">保留</td><td style="text-align:center;"></td><td style="text-align:center;">保留</td></tr></tbody></table><p><strong>示例</strong>：</p><ul><li>查询软件信息：01 31 00 00 00 00 00 00</li></ul><h2 id="底盘状态信息上传" tabindex="-1">底盘状态信息上传 <a class="header-anchor" href="#底盘状态信息上传" aria-label="Permalink to &quot;底盘状态信息上传&quot;">​</a></h2><h3 id="线速度、角速度反馈" tabindex="-1">线速度、角速度反馈 <a class="header-anchor" href="#线速度、角速度反馈" aria-label="Permalink to &quot;线速度、角速度反馈&quot;">​</a></h3><p>CAN_ID：0x10<br> 频率：50Hz</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0</td><td style="text-align:center;">线速度低八位</td><td style="text-align:center;">Int16</td><td style="text-align:center;">单位mm/s</td></tr><tr><td style="text-align:center;">Byte 1</td><td style="text-align:center;">线速度高八位</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">Byte 2</td><td style="text-align:center;">角速度低八位</td><td style="text-align:center;">Int16</td><td style="text-align:center;">单位：0.001rad/s</td></tr><tr><td style="text-align:center;">Byte 3</td><td style="text-align:center;">角速度高八位</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">Byte 4~Byte 7</td><td style="text-align:center;">保留</td><td style="text-align:center;"></td><td style="text-align:center;">保留</td></tr></tbody></table><p><strong>示例</strong>：</p><ul><li>64 00 64 00 00 00 00 00：线速度: 100mm/s 角速度: 0.1rad/s。</li><li>38 FF 64 00 00 00 00 00：线速度：-200mm/s 角速度：0.1rad/s。</li></ul><h3 id="轮速反馈" tabindex="-1">轮速反馈 <a class="header-anchor" href="#轮速反馈" aria-label="Permalink to &quot;轮速反馈&quot;">​</a></h3><p>CAN_ID：0x11<br> 频率：50Hz</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0</td><td style="text-align:center;">左轮速度值低八位</td><td style="text-align:center;">Int16</td><td style="text-align:center;">单位mm/s</td></tr><tr><td style="text-align:center;">Byte 1</td><td style="text-align:center;">左轮速度值高八位</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">Byte 2</td><td style="text-align:center;">右轮速度值低八位</td><td style="text-align:center;">Int16</td><td style="text-align:center;">单位mm/s</td></tr><tr><td style="text-align:center;">Byte 3</td><td style="text-align:center;">右轮速度值高八位</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">Byte 4~Byte 7</td><td style="text-align:center;">保留</td><td style="text-align:center;"></td><td style="text-align:center;">保留</td></tr></tbody></table><p><strong>示例</strong>：</p><ul><li>64 00 96 00 00 00 00 00：左轮速度100mm/s，右轮速度150mm/s。</li><li>38 FF 9C FF 00 00 00 00：左轮速度-200mm/s，右轮速度-100mm/s。</li></ul><h3 id="电机电流反馈" tabindex="-1">电机电流反馈 <a class="header-anchor" href="#电机电流反馈" aria-label="Permalink to &quot;电机电流反馈&quot;">​</a></h3><p>CAN_ID：0x12 频率：100Hz</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0</td><td style="text-align:center;">左电机电流低八位</td><td style="text-align:center;">Int16</td><td style="text-align:center;">单位：0.1A</td></tr><tr><td style="text-align:center;">Byte 1</td><td style="text-align:center;">左电机电流高八位</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">Byte 2</td><td style="text-align:center;">右电机电流低八位</td><td style="text-align:center;">Int16</td><td style="text-align:center;">单位：0.1A</td></tr><tr><td style="text-align:center;">Byte 3</td><td style="text-align:center;">右电机电流高八位</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">Byte 4~7</td><td style="text-align:center;">保留</td><td style="text-align:center;"></td><td style="text-align:center;">保留</td></tr></tbody></table><p>注：电流 = 数据值 * 0.1 A</p><p><strong>示例</strong>：</p><ul><li>32 00 46 00 00 00 00 00 ( 左电机电流：5A 右电机电流：7A )</li></ul><h3 id="遥控器数据上传" tabindex="-1">遥控器数据上传 <a class="header-anchor" href="#遥控器数据上传" aria-label="Permalink to &quot;遥控器数据上传&quot;">​</a></h3><p>CAN_ID：0x13 频率：50Hz</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0-1</td><td style="text-align:center;">右摇杆左右</td><td style="text-align:center;">Int16</td><td style="text-align:center;">左：-584、中：0、右：583</td></tr><tr><td style="text-align:center;">Byte 2-3</td><td style="text-align:center;">右摇杆上下</td><td style="text-align:center;">Int16</td><td style="text-align:center;">下：-584、中：0、上：583</td></tr><tr><td style="text-align:center;">Byte 4-5</td><td style="text-align:center;">左摇杆上下</td><td style="text-align:center;">Int16</td><td style="text-align:center;">下：-584、中：0、上：583</td></tr><tr><td style="text-align:center;">Byte 6-7</td><td style="text-align:center;">左摇杆左右</td><td style="text-align:center;">Int16</td><td style="text-align:center;">左：-584、中：0、右：583</td></tr></tbody></table><p>CAN_ID：0x14 频率：50Hz</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:left;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0-1</td><td style="text-align:center;">左拨轮前后</td><td style="text-align:center;">Int16</td><td style="text-align:left;">VRA，后：-584、 中：0、 前：583</td></tr><tr><td style="text-align:center;">Byte 2-3</td><td style="text-align:center;">右拨轮前后</td><td style="text-align:center;">Int16</td><td style="text-align:left;">VRB，后：-584、 中：0、 前：583</td></tr><tr><td style="text-align:center;">Byte 4</td><td style="text-align:center;">拨杆</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:left;">占位，Bit 0-1：SWA、Bit 2-3：SWB、Bit 4-5：SWC、Bit 6-7：SWD <br> 取值，0：下、1：中、2：上、3：保留</td></tr><tr><td style="text-align:center;">Byte 5</td><td style="text-align:center;">遥控状态</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:left;">Bit 0：是否离线，Bit 1-7：保留 <br>取值，0：否、1：是</td></tr><tr><td style="text-align:center;">Byte 6-7</td><td style="text-align:center;">保留</td><td style="text-align:center;"></td><td style="text-align:left;">保留</td></tr></tbody></table><p><strong>示例</strong>：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ID：0x13: 00 00 47 02 B8 FD 47 02</span></span></code></pre></div><ul><li>右摇杆-左右：0</li><li>右摇杆-上下：583</li><li>左摇杆-上下：-584</li><li>左摇杆-左右：583</li></ul><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ID：0x14: 47 02 64 00 98 00 00 00</span></span></code></pre></div><ul><li>左拨轮-前后：583</li><li>右拨轮-前后：100</li><li>拨杆：SWA-上(2)，SWB-中(1)，SWC-上(2)，SWD-下(0)</li><li>遥控状态：在线</li></ul><h3 id="系统信息" tabindex="-1">系统信息 <a class="header-anchor" href="#系统信息" aria-label="Permalink to &quot;系统信息&quot;">​</a></h3><p>CAN_ID：0x20 频率：100Hz</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:left;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0</td><td style="text-align:center;">控制输入模式</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:left;"><br> 0x00：空闲状态 <br> 0x01：遥控器模式 <br> 0x02：上位机模式 <br> 0x03：自动回充模式</td></tr><tr><td style="text-align:center;">Byte 1</td><td style="text-align:center;">电池电量百分比</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:left;">根据电压换算，范围0%~100%</td></tr><tr><td style="text-align:center;">Byte 2-3</td><td style="text-align:center;">电池电压</td><td style="text-align:center;">Unsigned int16</td><td style="text-align:left;">单位：0.1V</td></tr><tr><td style="text-align:center;">Byte 4-5</td><td style="text-align:center;">底盘状态</td><td style="text-align:center;">Unsigned int16</td><td style="text-align:left;">Bit0：硬件急停 <br> Bit1：遥控急停 <br> Bit2：软件急停 <br> Bit3：遥控离线 <br> Bit4：前防撞杆 <br> Bit5：后防撞杆 <br> Bit6~Bit15：保留 <br> 1：急停/触发/离线，0：正常/无急停/无触发/保留</td></tr><tr><td style="text-align:center;">Byte 6-7</td><td style="text-align:center;">底盘错误</td><td style="text-align:center;">Unsigned int16</td><td style="text-align:left;">Bit0：驱动器掉线 <br> Bit1：驱动器错误 <br> Bit2~Bit15：保留 <br> 1：掉线/错误，0：在线/正常 <br> 注：驱动器错误包括掉线</td></tr></tbody></table><p><strong>示例</strong>：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>02 39 FE 01 00 00 00 00</span></span></code></pre></div><p>控制输入模式：上位机模式 电池电量：57% 电池电压：51V 底盘状态：无急停，无掉线，无触发防撞杠 底盘错误：无错误</p><h3 id="自动回充" tabindex="-1">自动回充 <a class="header-anchor" href="#自动回充" aria-label="Permalink to &quot;自动回充&quot;">​</a></h3><p>CAN_ID：0x21 频率：100Hz</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:left;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0</td><td style="text-align:center;">回充模块掉线</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:left;">0x00：在线 <br> 0x01：掉线</td></tr><tr><td style="text-align:center;">Byte 1</td><td style="text-align:center;">当前回充工作模式</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:left;">0x00：空闲 <br> 0x01：红外模式 <br> 0x02：激光模式</td></tr><tr><td style="text-align:center;">Byte 2</td><td style="text-align:center;">回充模组状态</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:left;">Bit0：回充桩行程开关状态 <br> Bit1：回充头电压检测状态 <br> 0：弹起/未检测到电压 <br> 1：按下/检测到电压</td></tr><tr><td style="text-align:center;">Byte 3</td><td style="text-align:center;">红外回充模式状态</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:left;">0x00：寻找中心 <br> 0x01：已找到中心 <br> 0x02：信号丢失 <br> 0x03：铜片接触成功 <br> 0x04：对接成功 <br> 0x05：对接错误 <br> 0x07：退出充电状态 <br> 0x08：回充任务结束/回充任务关闭</td></tr><tr><td style="text-align:center;">Byte 4~7</td><td style="text-align:center;">保留</td><td style="text-align:center;"></td><td style="text-align:left;">保留</td></tr></tbody></table><p><strong>示例</strong>：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>00 01 00 01 00 00 00 00</span></span></code></pre></div><ul><li>回充模块：在线</li><li>当前回充工作模式：红外模式</li><li>回充模组状态：行程开关弹起，未检测到电压</li><li>红外回充模式状态：已找到中心</li></ul><h3 id="驱动器、电机故障" tabindex="-1">驱动器、电机故障 <a class="header-anchor" href="#驱动器、电机故障" aria-label="Permalink to &quot;驱动器、电机故障&quot;">​</a></h3><p>CAN_ID：0x30 频率：100Hz</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:left;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0-1</td><td style="text-align:center;">左电机故障</td><td style="text-align:center;">Unsigned int16</td><td style="text-align:left;">0：正常 <br> 1：故障 <br> Bit0：电池欠压 <br> Bit1：位置异常 <br> Bit2：霍尔错误 <br> Bit3：过流 <br> Bit4：超载 <br> Bit5：EEPROM故障 <br> Bit6：IGBT故障 <br> Bit7：驱动器过热 <br> Bit8：电机缺相 <br> Bit9：电流超差 <br> Bit10：速度超差 <br> Bit11：电机过热 <br> Bit12：电源过压 <br> Bit13：飞车故障 <br> Bit14：驱动器过热 <br> Bit15：保留</td></tr><tr><td style="text-align:center;">Byte 2-3</td><td style="text-align:center;">右电机故障</td><td style="text-align:center;">Unsigned int16</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">Byte 4~7</td><td style="text-align:center;">保留</td><td style="text-align:center;"></td><td style="text-align:left;">保留</td></tr></tbody></table><p><strong>示例</strong>：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>08 00 04 00 00 00 00 00</span></span></code></pre></div><ul><li>左电机故障：过流</li><li>右电机故障：霍尔错误</li></ul><h3 id="软件信息" tabindex="-1">软件信息 <a class="header-anchor" href="#软件信息" aria-label="Permalink to &quot;软件信息&quot;">​</a></h3><p>CAN_ID：0x41 查询式</p><table tabindex="0"><thead><tr><th style="text-align:center;">字节</th><th style="text-align:center;">说明</th><th style="text-align:center;">数据类型</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Byte 0</td><td style="text-align:center;">程序版本号</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">主版本号</td></tr><tr><td style="text-align:center;">Byte 1</td><td style="text-align:center;">程序版本号</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">次版本号</td></tr><tr><td style="text-align:center;">Byte 2</td><td style="text-align:center;">程序版本号</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">修订版本号</td></tr><tr><td style="text-align:center;">Byte 3</td><td style="text-align:center;">保留</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">保留</td></tr><tr><td style="text-align:center;">Byte 4</td><td style="text-align:center;">日期版本号</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">年份:年份后两位数</td></tr><tr><td style="text-align:center;">Byte 5</td><td style="text-align:center;">日期版本号</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">月份；范围1-12</td></tr><tr><td style="text-align:center;">Byte 6</td><td style="text-align:center;">日期版本号</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">日期：范围1-31</td></tr><tr><td style="text-align:center;">Byte 7</td><td style="text-align:center;">保留</td><td style="text-align:center;">Unsigned int8</td><td style="text-align:center;">保留</td></tr></tbody></table><p><strong>示例</strong>：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>02 00 00 00 18 09 01 00</span></span></code></pre></div><ul><li>软件版本：v2.0.0</li><li>日期：24年9月1日</li></ul>',87)]))}const o=e(a,[["render",r]]);export{h as __pageData,o as default};
